script:
const size = 16;
const floor = 5;
const floors = 8;
const center = (size * 0.5) - 0.5;
const radius = Math.sqrt(
  ((size * 0.5) ** 2) + ((size * 0.5) ** 2)
);
const height = ((floor + 1) * floors) - 1;
const offset = -8;

reset();
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < height; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const d = Math.sqrt(
      	(x - center) ** 2
      	+ (z - center) ** 2
      );
      let type = 0;
      if (d < (radius - 3.5)) {
        const floorY = y % floor;
        const isWall = d > radius - 4.5;
        if (
          floorY === 0
          || isWall
         ) {
          type = 1;
        }
        if (
          (d > radius - 4)
          && (
            floorY === 2
          	|| floorY === 3
          )
         ) {
          type = 2;
        }
      }
      update(offset + x, y, offset + z, type);
    }
  }
}

const elevator = {
  x: offset + 4,
  y: height - 3,
  z: offset + 12,
};
box(
  elevator.x, 0, elevator.z,
  8, height, 8,
  1
);
box(
  elevator.x, elevator.y, elevator.z,
  8, 9, 8,
  1
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  3
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
